import React, { useState } from "react";
import Login from "./Login";
import Signup from "./Signup";
imp
function Main() {
  const [login, setlogin] = useState(false);
  const log = () => {
    setlogin(false);
  };
  const sign = () => {
    setlogin(true);
  };
  return (
    <div
      style={{ border: "1px Solid Black", textAlign: "left", margin: "3px" }}
    >
      <button style={{}} onClick={log}>
        Login
      </button>
      <button onClick={sign}>SignUp</button>
      <div
      className="App"
        style={{
          border: "1px Solid Black",
          minHeight: "550px",
          margin: "3px",
        }}
      >
        {login ? <Signup /> : <Login />}
      </div>
    </div>
  );
}

export default Main;
